RenderingDisplayType_1.query:
q = load "ReportWithUsers";
q = filter q by 'RENDERING_TYPE' is not null && 'RENDERING_TYPE' != "";
q = group q by ('DISPLAY_TYPE','RENDERING_TYPE');
q = foreach q generate case when 'DISPLAY_TYPE' == "H" then "Hide Details" when 'DISPLAY_TYPE' == "S" then "Show Details" when 'RENDERING_TYPE' == "D" then "Dashboard" else "Standard" end as 'Display Type', case when 'RENDERING_TYPE' == "C" then "CSV" when 'RENDERING_TYPE' == "W" then "Web (HTML)" when 'RENDERING_TYPE' == "E" then "Email" when 'RENDERING_TYPE' == "P" then "Printable" when 'RENDERING_TYPE' == "X" then "Excel" when 'RENDERING_TYPE' == "J" then "JSON" when 'RENDERING_TYPE' == "D" then "DummyData" else "Standard" end as 'Rendering Type',  count() as 'Executions', sum('ROW_COUNT') as 'Row Count', unique(USER_ID_DERIVED) as 'Users';
q = order q by ('Rendering Type' asc, 'Display Type' asc);
q = limit q 2000;
